		emit YieldDeposited(msg.sender, market_, newCommitment_, amount_);
		return true;
	}

	function _preDepositProcess(
		address account_,
		bytes32 market_,
		uint256 amount_
	) internal {
		_isMarketSupported(market_);
		_createSavingsAccount(account_);
		_connectMarket(market_, amount_);
		// return this;
